import React, { Component } from 'react'
import { TextField } from '@material-ui/core'


export class LoginChat extends Component {
    constructor(props) {
        super(props);
        this.state = {
            nickname:"",
            error:""
        };
    }
    render() {
        const{ nickname, error } = this.state
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                <h2>Type nickName to continue</h2>
                <TextField
                    id="outlined-nickname-input"
                    label="Name"
                    type="text"
                    name="name"
                    autoComplete="name"
                    margin="normal"
                    variant="outlined"
                    value={nickname}
                    onChange={this.handleChange}
                    fullWidth
                    required
                />
                <div className="err">
                    {error ? error : null }
                </div>
                </form>
            </div>
        )
    }
}
